 * Table stuff
 */

  min-width: 100%;

  margin-top: 2rem;
}

  overflow-y: auto;
  overflow-x: none;
  max-height: 14rem;
  border: 1px solid #3E3E40;
}

  white-space: nowrap;
  padding: 0.625rem;

  overflow-x: none;
}

th,
td {

  padding: 0.25rem;
  background-color: transparent;
}

  height: 1.875rem;
  font-size: 0.8125rem;
}

  background-color: #E9EAEA;
}

tr:nth-child(even),
th {
  background-color: #FFFFFF;
}

/*
 * Chart stuff
 */

svg {
  margin-top: 2rem;
  margin-bottom: 2rem;
  max-width: 100%;
}
